// MainLayout.js
import React, { useState } from "react";

// Example components to render in the main content area
const ComponentOne = () => <div>Component One Content</div>;
const ComponentTwo = () => <div>Component Two Content</div>;
const ComponentThree = () => <div>Component Three Content</div>;

const MainLayout = () => {
  const [selectedComponent, setSelectedComponent] = useState("ComponentOne");

  const renderComponent = () => {
    switch (selectedComponent) {
      case "ComponentOne":
        return <ComponentOne />;
      case "ComponentTwo":
        return <ComponentTwo />;
      case "ComponentThree":
        return <ComponentThree />;
      default:
        return <ComponentOne />;
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.sidebar}>
        <ul>
          <li onClick={() => setSelectedComponent("ComponentOne")}>Component One</li>
          <li onClick={() => setSelectedComponent("ComponentTwo")}>Component Two</li>
          <li onClick={() => setSelectedComponent("ComponentThree")}>Component Three</li>
        </ul>
      </div>
      <div style={styles.mainContent}>
        {renderComponent()}
      </div>
    </div>
  );
};

// Basic styling for the layout
const styles = {
  container: {
    display: "flex",
    height: "100vh",
  },
  sidebar: {
    flexBasis: "33.33%", // 1/3 of the width
    backgroundColor: "#f4f4f4",
    padding: "20px",
    boxShadow: "2px 0 5px rgba(0,0,0,0.1)"
  },
  mainContent: {
    flexBasis: "66.67%", // 2/3 of the width
    padding: "20px",
    backgroundColor: "#fff",
  }
};

export default MainLayout;
